        public string TipoDanfe => "NFe";
        /// <summary>
        /// Quantidade de itens para a primeira páginas
        /// </summary>
        const int QTD_PRODS_PRIM_PAG = 10;
        /// <summary>
        /// Quantidade de itens para as páginas subsequentes a primeira
        /// </summary>
        const int QTD_PRODS_PRX_PAG = 25;

        #endregion
        private int _totPage;
        /// <summary>
        /// Calcula total de paginas
        /// </summary>
        /// <param name="totitens"></param>
        /// <param name="page"></param>
        /// <returns></returns>
        private int CalcularTotPaginas(int totitens, int page)
        {
            var pagina = totitens - page;
            _totPage++;
            if (pagina <= 0) return _totPage;
            CalcularTotPaginas(pagina, QTD_PRODS_PRX_PAG);

            return _totPage;
        }
        #region Produtos e Paginas
         
        /// <summary>
        /// Montar produtos para  a primeira pagina
        /// </summary>
        /// <param name="totitens"></param>
        /// <param name="entidade"></param>
        /// <param name="numPag"></param>
        /// <param name="totPag"></param> 
        /// <returns></returns>
        private string MontarProdutosPrimeiraPagina(int totitens, DanfeNFe entidade, int numPag, int totPag)
        {
             
            var strbProd = new StringBuilder();
            var prods = entidade.Produtos.ToList();
            var list = prods.Take(QTD_PRODS_PRIM_PAG).ToList();//Obter da coleção a quantidade permitida para a primeira pagina

            foreach (var item in list)
            {

                #region Processar

                var dic = new Dictionary<string, string>();
                MontarProdutos(dic, item);
                var p1 = LerTemplateEsubstituirTags(Properties.Resources.Products_Mod55, dic);
                strbProd.Append(p1);

                #endregion 
            }
             
            return strbProd.ToString();
        }

        /// <summary>
        /// 
        /// </summary>
        /// <param name="entidade"></param>
        /// <param name="produtos"></param>
        /// <param name="totPag">Total de páginas</param>
        /// <returns></returns>
        private string MontarProdutosPorPagina(DanfeNFe entidade,List<Produto>produtos,int totPag)
        {
            

            var ii = 0;
            var idxIni = 0;
            var numPag = 2;//Numero da pagina inicial
            var totItens = produtos.Count;//Quantidade total da coleção
            int range = (totItens <= QTD_PRODS_PRX_PAG)?totItens: QTD_PRODS_PRX_PAG;//Quantidade de itens por pagina,sendo total de itens menor que o range, entao alterar o range
            var strbProd = new StringBuilder();
            var strbTemplate = new StringBuilder();
            

            while (totItens > ii)//Enquanto não zerar a iteração por todos os itens, fazer
            {
                var list = produtos.GetRange(idxIni, range);
              
                strbProd.Clear();

                foreach (var item in list)
                {

                    #region Processar


                    var dic = new Dictionary<string, string>();
                    MontarProdutos(dic, item);
                    var p1 = LerTemplateEsubstituirTags(Properties.Resources.Products_Mod55, dic);
                    strbProd.Append(p1);

                    #endregion


                    ii++;

                }

                #region Processar 2

                var template1 = Properties.Resources.NextPage_Mod55;
                var dic1 = new Dictionary<string,string>();
                dic1.Add("#Products#", strbProd.ToString());

                //Substituir tag Produtos
                var template2 = Substituir(template1, dic1);
                //Subsituir tag Emitente
                var emitente = MontarEmitente(entidade, $"{numPag} de {totPag}");
                var dic2 = new Dictionary<string, string>();
                dic2.Add("#Issuer#", emitente);
                var template3 = Substituir(template2, dic2);

                strbTemplate.Append(template3);

                #endregion

                numPag++;//Numero da pagina no processamento
                idxIni += range;

                #region Calcular o intervalo dentro do range especificado para a coleção
                if ((totItens - ii) < range)
                {
                    range = (totItens - ii);
                }
                else
                {
                    var count = totItens - range;
                    range = totItens > count ? range : count;
                }
                /*
                 Exemplo de intervalos considerando haver 33 itens na coleção
                 intervalos de 10 em  10
                 GetRange(0,10)
                 GetRange(10,10)
                 GetRange(20,10)
                 GetRange(30,3)
                 */
                #endregion

            }


            return strbTemplate.ToString();

        }

        private static void MontarProdutos(Dictionary<string, string> dic, Produto item)
        {
            dic.Add("#ProductCode#", item.Codigo);
            dic.Add("#Description#", $"{item.Descricao?.Trim()} {item.InfAdic?.Trim()}".Truncar(138));
            dic.Add("#NCM#", item.Ncm);
            dic.Add("#ProductOrigin#", item.Origem);
            dic.Add("#CFOP#", item.Cfop);
            dic.Add("#Unit#", item.Unidade);
            dic.Add("#Quantity#", item.Quantidade.FormatarNumeroQuantidadeDanfe());
            dic.Add("#UnityValue#", item.ValorUnitario.FormatarNumeroDanfe());
            dic.Add("#Amount#", item.ValorIcms.FormatarNumeroDanfe());
            dic.Add("#CalculationBasis#", item.BaseCalculo.FormatarNumeroDanfe());
            dic.Add("#ICMSValue#", item.ValorIcms.FormatarNumeroDanfe());
            dic.Add("#ICMSRate#", item.ValorIcmsPart.FormatarNumeroDanfe());
            dic.Add("#IPIValue#", item.ValorIpi.FormatarNumeroDanfe());
            dic.Add("#IPIRatePercentual#", item.ValorIpiPerc.FormatarNumero());
        }

        #endregion

        /// <summary>
        ///     Montar cabeçalho da DANFE
        /// </summary>
        /// <param name="entidade"></param>
        /// <returns></returns>
        private string MontarCabecalho(DanfeNFe entidade)
        {
            var list = new Dictionary<string, string>();
            list.Add("#IssuerCompanyName#", entidade.Emitente.Nome);
            list.Add("#RecipientCompanyName#", entidade.Destinatario.Nome ?? entidade.Destinatario.Nome);
            list.Add("#RecipientCompanyNameStyle#", string.IsNullOrWhiteSpace(entidade.Destinatario.Nome) ? "" : "font-size:0.8em;");
            list.Add("#DocumentAmount#", entidade.ValorTotNota.FormatarNumeroDanfe());
            list.Add("#Number#", entidade.NumNota);
            list.Add("#Serie#", entidade.SerieNota);
            return LerTemplateEsubstituirTags(Properties.Resources.Header_Mod55, list);
        }

        private string MontarCorpo(DanfeNFe entidade)
        {
            var dic = new Dictionary<string, string>();
            //var emit = MontarEmitente(entidade);
            var count = entidade.Produtos.Count;
            var totPag = CalcularTotPaginas(count, QTD_PRODS_PRIM_PAG);
            var emit = MontarEmitente(entidade, $"1 de {totPag}");
          
            dic.Add("#Issuer#", emit);
            var dest = MontarDestinatario(entidade);
            dic.Add("#Recipient#", dest);
            var fatura = MontarFatura(entidade);
            dic.Add("#Invoice#", fatura);
            var totalizadores = CalculoImpostos(entidade);
            dic.Add("#Totals#", totalizadores);
            var transporte = MontarTransportadora(entidade);
            dic.Add("#Transport#", transporte);

            #region Montar lista de produtos

            var produtos1 = MontarProdutosPrimeiraPagina(count - 1, entidade, 1, totPag);
            dic.Add("#Products#", produtos1);
            //Sendo a quantidade de itens maior que a quantidade de itens permitidos na primiera 
            //pagina, entao processar páginas subsequentes...
            if (count > QTD_PRODS_PRIM_PAG)
            {
                var idx = count - QTD_PRODS_PRIM_PAG;
                var newList = entidade.Produtos.ToList().GetRange(QTD_PRODS_PRIM_PAG, idx);
                var template = MontarProdutosPorPagina(entidade, newList, totPag);
                dic.Add("#Products2#", template);
            }
            else
            {
                dic.Add("#Products2#", "");
            }

            #endregion

            var issqn = MontarIssqn(entidade);
            dic.Add("#ISSQN#", issqn);
            var infAdic = MontarInfAdc(entidade);
            dic.Add("#AdditionalInformation#", infAdic);
            dic.Add("#Credito#", entidade.Creditos);
            return LerTemplateEsubstituirTags(Properties.Resources.Body_Mod55, dic);
        }

        private string MontarInfAdc(DanfeNFe entidade)
        {
            if (entidade.Inf == null) return "";
            var dic = new Dictionary<string, string>();
            dic.Add("#Information#", entidade.Inf.InfComplementares);
            dic.Add("#FiscoInformation#", entidade.Inf.InfFisco);
            return LerTemplateEsubstituirTags(Properties.Resources.AdditionalInformation_Mod55, dic);
        }

        private string MontarIssqn(DanfeNFe entidade)
        {
            if (entidade.ISsqn == null) return "";
            var dic = new Dictionary<string, string>();
            dic.Add("#IM#", entidade.ISsqn.Im);
            dic.Add("#ServicesAmount#", entidade.ISsqn.ValorTotServ.FormatarNumeroDanfe());
            dic.Add("#ISSCalculationBasisAmount#", entidade.ISsqn.BaseCalculo.FormatarNumeroDanfe());
            dic.Add("#ISSAmount#", entidade.ISsqn.ValorIssqn.FormatarNumeroDanfe());
            return LerTemplateEsubstituirTags(Properties.Resources.ISSQN_Mod55, dic);
        }

        private string MontarProdutos(DanfeNFe entidade)
        {
            var str = new StringBuilder();
           
            foreach (var item in entidade.Produtos)
            {
                var dic = new Dictionary<string, string>();

                dic.Add("#ProductCode#", item.Codigo);
                dic.Add("#Description#", $"{item.Descricao?.Trim()} {item.InfAdic?.Trim()}");
                dic.Add("#NCM#", item.Ncm);
                dic.Add("#ProductOrigin#", item.Origem);
                dic.Add("#CFOP#", item.Cfop);
                dic.Add("#Unit#", item.Unidade);
                dic.Add("#Quantity#", item.Quantidade.FormatarNumeroQuantidadeDanfe());
                dic.Add("#UnityValue#", item.ValorUnitario.FormatarNumeroDanfe());
                dic.Add("#Amount#", item.ValorIcms.FormatarNumeroDanfe());
                dic.Add("#CalculationBasis#", item.BaseCalculo.FormatarNumeroDanfe());
                dic.Add("#ICMSValue#", item.ValorIcms.FormatarNumeroDanfe());
                dic.Add("#ICMSRate#", item.ValorIcmsPart.FormatarNumeroDanfe());
                dic.Add("#IPIValue#", item.ValorIpi.FormatarNumeroDanfe());
                dic.Add("#IPIRatePercentual#", item.ValorIpiPerc.FormatarNumero());
                str.Append(LerTemplateEsubstituirTags(Properties.Resources.Products_Mod55, dic));
            }

            return str.ToString();
        }

