        private string MontarVolume(DanfeNFe entidade)
        {
            if (!entidade.Volumes.Any()) return "";
            var dic = new Dictionary<string, string>();
            var qtdVolumes = entidade.Volumes.Count;
            if (qtdVolumes == 1)
            {
                var item = entidade.Volumes.ToList()[0];
                dic.Add("#Quantity#", item.Quantidade);
                dic.Add("#Specie#", item.Especie);
                dic.Add("#Brand#", item.Marca);
                dic.Add("#GrossWeight#", item.PesoBruto.FormatarNumero());
                dic.Add("#NetWeight#", item.PesoLiq.FormatarNumero());
                return LerTemplateEsubstituirTags(Properties.Resources.Volume_Mod55, dic);
            }

            var listVol = MontarVolumes(entidade);
            dic.Add("#VolumesItems#", listVol);
            return LerTemplateEsubstituirTags(Properties.Resources.VolumesListItem_Mod55, dic);
        }

        private string MontarVolumes(DanfeNFe entidade)
        {
