            foreach (var item in entidade.Volumes)
            {
                var dic = new Dictionary<string, string>();
                dic.Add("#Quantity#", item.Quantidade);
                dic.Add("#Specie#", item.Especie);
                dic.Add("#Brand#", item.Marca);
                dic.Add("#GrossWeight#", item.PesoBruto.FormatarNumero());
                dic.Add("#NetWeight#", item.PesoLiq.FormatarNumero());
                str.Append(LerTemplateEsubstituirTags(Properties.Resources.VolumesListItem_Mod55, dic));
            }

            return str.ToString();
        }

