        private string MontarEmitente(DanfeNFe entidade,string pagina)
        {
            var dic = new Dictionary<string, string>();
            dic.Add("#Logo#",
                     !string.IsNullOrEmpty(entidade.Emitente.Logo)
                             ? entidade.Emitente.Logo
                             : "data:image/png;base64,");
            dic.Add("#BarCode#", string.IsNullOrEmpty(entidade.Chave) ? string.Empty : MontarCodigoBarras(entidade.Chave));
            dic.Add("#CompanyName#", entidade.Emitente.Nome?.ToUpper());
            dic.Add("#VerificationCode#", string.IsNullOrEmpty(entidade.Chave) ? string.Empty : entidade.Chave.FormatarEspaco(4));
            dic.Add("#OperationType#", entidade.TipoOper);
            dic.Add("#Number#", entidade.NumNota);
            dic.Add("#Serie#", entidade.SerieNota);
            dic.Add("#IEST#", entidade.IeSt ?? string.Empty);
            dic.Add("#IE#", entidade.Emitente.Ie);
            dic.Add("#CpfCnpj#", Utils.FormatarCnpjCpf(entidade.Emitente.CnpjCpf));
            var natOper = string.IsNullOrWhiteSpace(entidade.NatOperacao) ? "" :
                    entidade.NatOperacao.Length > 55 ? entidade.NatOperacao?.ToUpper().Substring(0, 55) : entidade.NatOperacao?.ToUpper();
            dic.Add("#NatureOperation#", natOper);
            dic.Add("#Protocol#", entidade.ProtocoloUso ?? " - ");
            dic.Add("#Address#", entidade.Emitente.Endereco.NomeEnd);
            dic.Add("#Page#", pagina);
            return LerTemplateEsubstituirTags(Properties.Resources.Issuer_Mod55, dic);
        }

