        private string MontarCodigoBarras(string nFeId)
        {
            return "data:image/png;base64, " + new Barcode(nFeId, Type.Code128).GetBase64Image();
        }
         
        #region Implementacoes

        /// <summary>
        ///     Obter Danfe
        /// </summary>
        /// <returns></returns>
        public Documento ObterDocHtml()
        {
            var cabecalho = MontarCabecalho(_danfe);
            var corpo = MontarCorpo(_danfe);
            var rodape = MontarRodape(_danfe);
            //===============================
            string str1 = MontagemPagina(cabecalho, corpo, rodape); 
            return new Documento { Html = str1};
        }

        /// <summary>
        /// Rodape
        /// </summary>
        /// <param name="entidade"></param>
        /// <returns></returns>
        private string MontarRodape(DanfeNFe entidade)
        {
            string str1;
            var str2 = "";
            switch (entidade.Status)
            {
                case Status.Autorizada:
                    str1 = "";
                    break;
                case Status.Cancelada:
                    str1 = "NOTA FISCAL CANCELADA";
                    break;
                case Status.NaoAuotorizada:
                    str1 = "NOTA FISCAL DENEGADA";
                    break;
                case Status.EsperandoAutorizacao:
                    str1 = "PRÉ-VISUALIZAÇÃO";
                    str2 = "SEM VALOR FISCAL";
                    break;
                case Status.Negada:
                    str1 = "NOTA FISCAL DENEGADA";
                    break;
                case Status.Recusada:
                    str1 = "SEM VALOR FISCAL";
                    break;
                default:
                    throw new ArgumentOutOfRangeException();
            }

            var dic = new Dictionary<string, string>();

            dic.Add("#WaterMark#", str1);
            dic.Add("#WithOutValue#", str2);
            return LerTemplateEsubstituirTags(Properties.Resources.Footer_Mod55, dic); 
        }
        /// <summary>
        ///     Montar página principal
        /// </summary>
        /// <param name="header"></param>
        /// <param name="body"></param>
        /// <param name="footer"></param>
        /// <returns></returns>
        private string MontagemPagina(string header, string body, string footer)
        {
            return LerTemplateEsubstituirTags(Properties.Resources.Structure_Mod55,
                    new Dictionary<string, string>
                    {
                            {"#Header#", header},
                            {"#Body#", body},
                            {"#Footer#", footer}
                    });
        }
        public readonly DanfeNFe _danfe;
         
        public DanfeNFeHtml(DanfeNFe danfe)
        {
            _danfe = danfe;
        }

        #endregion
    }
